const data = [
  {
    id: "my-site",
    label: "menu.my-site",
    to: "/app/gogo",
    subs: [
      {
        label: "menu.dashboard",
        to: "/app/gogo/start"
      },
      {
        label: "menu.site-information",
        to: "/app/gogo/start"
      }
    ]
  },
  {
    id: "products",
    label: "menu.products",
    to: "/app/second-menu",
    subs: [
      {
        label: "menu.products",
        to: "/app/second-menu/second"
      },
      {
        label: "menu.categories",
        to: "/error"
      }
    ]
  },
  {
    id: "people",
    label: "menu.people",
    to: "/app/aaa-menu",
    subs: [
      {
        label: "menu.users",
        to: "/app/second-menu/second"
      },
      {
        label: "menu.customers",
        to: "/app/second-menu/second"
      }
    ]
  },
  {
    id: "reports",
    label: "menu.reports",
    to: "/app/aaa-menu"
  }
];
export default data;
